import React, { Component, Content } from 'react';
import UserPanel from './UserPanel';
import TabBar from './TabBar';
import UpcomingEventsTab from './UpComingEventsTab';







export default class ProfilePage extends Component {
  render() {
    return (
        <Container>
      <UserPanel />

      <Content>
        <TabBar>
          <TabBar.Link title="Upcoming events" active />
          <TabBar.Link title="Friends" />
        </TabBar>

        <UpcomingEventsTab />
        <FriendsTab />
      </Content>
    </Container>



    );
  }
}
